          culpa qui officia deserunt mollit anim id est laborum.
        </Text>
      </ScrollView>
            </View>
        )
    }
}

const styles = StyleSheet.create({
    container: {
    flex: 1,
  },

  triangleCorner: {
    width: 0,
    height: 0,
    backgroundColor: "transparent",
    borderStyle: "solid",
    borderRightWidth: 300,
    borderTopWidth: 300,
    borderRightColor: "transparent",
    borderTopColor: "#008763",
  },

  teste: {
    flex: 0.,
